sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
    var v_user_name = inputs.v_user_name;
    // search detail
    var gr = new GlideRecord("sys_user");
    gr.addQuery('user_name', v_user_name);
    gr.query();
    var list = [];
    while (gr.next()) {
        var info = {};
        info.v_user_name = gr.getValue('user_name'); 
        info.v_mail_address = gr.getValue('email'); 
        list.push(info);
    }
    if (list.length == 0) {
        outputs.detail_info_json = null;
    } else {
        outputs.detail_info_json = JSON.stringify(list);
    }
    
})(inputs, outputs);

